import React from 'react'
import styled from 'styled-components'

const Main = styled.div`
    background-color: #EBECF0;
    border-radius: 4px;
    padding: 0px 10px;
    width: 250px;    
`

const TopBottom = styled.div`
    background-color: transparent;
    width: 100%;
    height: 60px;
    display: flex;
    justify-content: space-between;
    align-items: center;
`

const Title = styled.p`
    color: #172B52;
    font-size: 1em;
    font-weight: bold;  
    width: 90%;    
`

const ButtonStyled = styled.button`
    display: flex;
    align-items: center;
    background-color: transparent;  
    padding: 10px 10px;
    width: 100%;
    border: none;      
`

const TitleButton = styled.p`
    font-size: 1em;
    margin-left: 2px;
` 

const List = (props) => {
    return(
        <Main>
            <TopBottom>
                <Title>Lista 1</Title>
                <i className="fa fa-ellipsis-h"></i>
            </TopBottom>
            <TopBottom>
                <ButtonStyled>
                    <i className="fa fa-plus"></i>
                    <TitleButton>Adicionar outro cart√£o</TitleButton>
                </ButtonStyled>
            </TopBottom>
        </Main>
    )
}

export default List
